import { style } from "typestyle";

const  BenefitParallaxGalleryStyle = style({
    position: "relative",
    width: '90%',
    height: '100vh',
    padding: '20px',
    margin: 'auto',
    overflowY: 'scroll',
    $nest: {
        '&::-webkit-scrollbar': {
            width: '5px',     /* Tama単o del scroll en vertical */
            height: '100%',    /* Tama単o del scroll en horizontal */
            color: 'red',
            borderRight: 'solid 1px white'
        },
        '&::-webkit-scrollbar-thumb': {
            background: 'white',
            borderRadius: '1px'
        },
        '& .item:nth-child(1)': {
            position: "absolute",
            left: 20,
            top: 0,
            top: '80px'
        },
        '& .item:nth-child(2)': {
            position: "absolute",
            right: 20,
            top: '20px'
        },
        '& .item:nth-child(3)': {
            position: "absolute",
            top: '500px',
            left: '35%'
        },
        '& .item:nth-child(4)': {
            position: "absolute",
            left: 20,
            top: '110vh'
        },
        '& .item:nth-child(5)': {
            position: "absolute",
            right: 20,
            top: '100vh'
        },
    }
})

export default BenefitParallaxGalleryStyle
